  root: {
    "& > svg": {
      margin: theme.spacing(2),
    },
  },
}));
class Amenu extends Component {
  render() {
    return (
      <div className="col-3 amenu ">
        <p className="text-center meteo-text my-5">
          <WiThermometer fontSize="large" />
          METEOROLOG
        </p>
      </div>
    );
  }
}

export default Amenu;
